import React from 'react';
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import DatePicker from "react-datepicker/es";
import Image from "react-bootstrap/Image";

class ExampleCustomInput extends React.Component {

  render () {
    return (
      <button
        className="example-custom-input"
        onClick={this.props.onClick}>
        {this.props.value}
      </button>
    )
  }
}

const MyDataPicker = ({handleChange, startDate}) => (
    <Row>
        <Col className='justify-content-md-start ' style={{whiteSpace: 'nowrap'}}>
            <label>
                <div>
                <DatePicker
                    className="myDataPicker "
                    onChange={handleChange}
                    minDate={new Date()}
                    placeholderText={startDate.getDate()}
                />
                <Image alt='' src="https://img.icons8.com/ultraviolet/40/000000/today.png"
                       style={{pointerEvents: 'none', marginBottom: '5px'}}
                />
                <DatePicker
                    className="myDataPickerTime"
    selected={startDate}
    onChange={handleChange}
    showTimeSelect
    showTimeSelectOnly
    timeIntervals={15}
    dateFormat="h:mm"
    timeCaption="Time"
/>
                </div>
            </label>
        </Col>
    </Row>

);
export default MyDataPicker;
